import { useContext } from "react"
import { productContext } from "../MainSection"


function TvCom() {

    const context = useContext(productContext)
    const filterdProduct = context.productDetail.filter((item) => {
        return item.type === 'tv'
    })
    console.log(filterdProduct);
    return (
        <div>
            <h1>Tv List</h1>
            <hr />
            <div className="card">
                {filterdProduct.map((data) => {
                    return <div className="card-body">
                        <h5 className="card-title">{data.productName}</h5>
                        <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>

                    </div>
                })}
            </div>
        </div>
    )
}
export default TvCom
